import React from "react";
import "./css/style.css";
import "./css/bootstrap.min.css";
import "./css/animate.css";
import "./css/animate.min.css";
import "./App.css";
import Header from "./components/common/Header";
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import {
  Home,
  Booking,
  AboutUs,
  Contact,
  PageNotFound,
  Room,
  Services,
  Team,
  Testimonial,
  ReservasActivas,
} from "./pages/index";
import Footer from "./components/common/Footer";
import RoomDetails from "./components/RoomDetails";
import Login from "./";  // Importa el componente de login
import Dashboard from "./components/Dashboard";  // Importa el componente del dashboard protegido

export default function App() {
  return (
    <>
      <div className="app-container">
        <Router>
          <Header />
          <div className="content-container">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/booking" element={<Booking />} />
              <Route path="/ReservasActivas" element={<ReservasActivas />} />
              <Route path="/team" element={<Team />} />
              <Route path="/testimonial" element={<Testimonial />} />
              <Route path="/about" element={<AboutUs />} />
              <Route path="/contact" element={<Contact />} />
              <Route path="/rooms" element={<Room />} />
              <Route path="/services" element={<Services />} />
              <Route path="/room/:id" element={<RoomDetails />} />
              <Route path="/login" element={<Login />} />  {/* Ruta de login */}
              <Route path="/dashboard" element={<Dashboard />} />  {/* Ruta protegida */}

              <Route path="/*" element={<PageNotFound />} />
            </Routes>
          </div>
          <Footer />
        </Router>
      </div>
    </>
  );
}
